sparqlQuery:
PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  dct:  <http://purl.org/dc/terms/>
PREFIX  dbc:  <http://dbpedia.org/resource/Category:>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT  ?uri
WHERE
  { ?uri  rdf:type     dbo:Ship ;
          dct:subject  dbc:Christopher_Columbus ;
          dct:subject  dbc:Exploration_ships
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type             dbo:Company ;
          dbo:industry         res:Electronics ;
          dbo:foundationPlace  res:Beijing
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>

SELECT DISTINCT  ?uri
WHERE
  { ?x  dbo:city    res:Ankara ;
        dbo:league  res:Turkish_Ice_Hockey_First_League ;
        dbo:coach   ?uri
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  dct:  <http://purl.org/dc/terms/>
PREFIX  dbc:  <http://dbpedia.org/resource/Category:>

SELECT  ?company
WHERE
  { ?company  dct:subject     dbc:Car_manufacturers_of_Germany ;
              dbo:equity      ?equity ;
              dbo:netIncome   ?netIncome ;
              dbo:production  ?production ;
              dbo:revenue     ?revenue
  }
ORDER BY DESC(?equity)
